    characters = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789'
    return ''.join(random.choice(characters) for _ in range(length))

def generate_random_number():
    return random.randint(0, 100)

def generate_random_boolean():
    return random.choice([True, False])

def generate_random_list(length):
    return [generate_random_string(10) for _ in range(length)]

def generate_random_dict(length):
    return {generate_random_string(10): generate_random_number() for _ in range(length)}

def generate_random_object():
    return {
        'string': generate_random_string(10),
        'number': generate_random_number(),
        'boolean': generate_random_boolean(),
        'list': generate_random_list(5),
        'dict': generate_random_dict(5)
    }

def generate_random_array():
    return [generate_random_object() for _ in range(5)]

print(generate_random_array())
